DROP TABLE IF EXISTS `mod_multi_class_master_skill_spells`;
CREATE TABLE `mod_multi_class_master_skill_spells` (
	`MasterSkillID` MEDIUMINT(7) NOT NULL,
	`LearnSpellClassID` TINYINT(3) NOT NULL,
	`LearnSpellID` MEDIUMINT(7) NOT NULL,
	PRIMARY KEY (`MasterSkillID`, `LearnSpellClassID`, `LearnSpellID`) USING BTREE
);





























































































































































































































































































